tables.table_schema:
CREATE TABLE Reports (
    report_id SERIAL PRIMARY KEY,
    report_name VARCHAR(255) NOT NULL,
    report_date DATE NOT NULL
);

CREATE TABLE aggregate_data (
    id INT PRIMARY KEY,
    report_name VARCHAR(255),
    data_source VARCHAR(255),
    date_created DATE
);

CREATE TABLE report_summary (
    id INT PRIMARY KEY,
    report_name VARCHAR(255),
    total_records INT,
    last_updated TIMESTAMP
);

CREATE TABLE visualization_data (
    id INT PRIMARY KEY,
    visualization_name VARCHAR(255),
    data_type VARCHAR(50),
    data_value FLOAT
);

CREATE TABLE reports (
    report_id SERIAL PRIMARY KEY,
    report_name VARCHAR(255) NOT NULL,
    report_date DATE,
    report_data TEXT
);

CREATE TABLE visualizations (
    visualization_id SERIAL PRIMARY KEY,
    visualization_name VARCHAR(255) NOT NULL,
    visualization_type VARCHAR(50),
    visualization_data JSON
);

CREATE TABLE data_sources (
    data_source_id SERIAL PRIMARY KEY,
    data_source_name VARCHAR(255) NOT NULL,
    data_source_type VARCHAR(50),
    data_source_connection_string VARCHAR(255)
);

CREATE TABLE users (
    user_id SERIAL PRIMARY KEY,
    username VARCHAR(50) UNIQUE NOT NULL,
    password VARCHAR(255) NOT NULL
);

CREATE TABLE roles (
    role_id SERIAL PRIMARY KEY,
    role_name VARCHAR(50) NOT NULL,
    role_description TEXT
);
